import socket
import json
import sys
from pypresence import Presence
import requests
import time
import pystray
from PIL import Image
import io
import base64
import os
import signal
import threading

# Configuración del servidor
HOST = '127.0.0.1'  # IP local donde el servidor estará escuchando
PORT = 5000         # Puerto donde el servidor estará escuchando
server_socket = None

# Configuración de Discord Rich Presence
client_id = '1188557253914148894'
RPC = Presence(client_id)
RPC.connect()

# Establecer tiempo de inactividad antes de cambiar a "Idle"
timeToidle = time.time()

# Función para cerrar la aplicación
def on_exit_clicked(icon, item):
    #obtener el pid del proceso actual
    # cerrar el icono de la bandeja
    icon.stop()
    pid = os.getpid()
    #matar el proceso
    print("Cerrando la aplicación en 1 segundos...")
    time.sleep(1)
    os.kill(pid, signal.SIGTERM)

# Crear el icono de la bandeja
def create_tray_icon():
    print("Iniciando el icono de la bandeja del sistema...")
    # Aquí usamos la imagen en base64 previamente convertida
    image_base64 = ""  # Pega aquí la cadena base64 que obtuviste antes

    # Decodificar la imagen desde base64
    image = Image.open(io.BytesIO(base64.b64decode(image_base64)))
    icon = pystray.Icon("app_name", image, "CKworker")
    
    # Menú de opciones del icono
    menu = pystray.Menu(pystray.MenuItem("Salir", on_exit_clicked))
    icon.menu = menu
    print("Icono de la bandeja del sistema iniciado")
    icon.run()
    


# Actualización predeterminada de Discord Rich Presence
def update_rpc(url=None, title=None, streamer=None, mode=None):
    global timeToidle
    if url and title and streamer and mode:
        timeToidle = time.time()
        if mode == 1:
            state = f"Moderando a {streamer}"
            large_image = "2144123"
        elif mode == 2:
            state = f"Viendo a {streamer}"
            large_image = "3991943"
        else:
            state = "Idle"
        RPC.update(
            state=state,
            details=title,
            large_image=large_image,
            large_text="Spyflow rpc",
            buttons=[{"label": "Ver", "url": url}]
        )
    else:
        if time.time() - timeToidle > 300:
            RPC.update(
                state="Idle",
                details="Sin actividad",
                large_image="idle",
                large_text="Spyflow rpc"
            )

# Función para manejar las solicitudes de la extensión de Chrome
def handle_extension_requests():
    global server_socket

    print("Iniciando servidor...")
    
    try:
        server_socket = socket.socket(socket.AF_INET, socket.SOCK_STREAM)
        server_socket.bind((HOST, PORT))
        server_socket.listen()


        print(f"Servidor iniciado y escuchando en {HOST}:{PORT}")

        while True:

            client_socket, client_address = server_socket.accept()
            print(f"Conexión establecida desde {client_address}")

            try:
                # Recibir datos del cliente (extensión de Chrome)
                data = client_socket.recv(1024)
                if not data:
                    continue

                # Decodificar los datos recibidos
                headers, body = data.decode('utf-8').split('\r\n\r\n', 1)
                request_line, *header_lines = headers.split('\r\n')
                method, path, _ = request_line.split(' ')

                # Manejar la solicitud OPTIONS (CORS)
                if method == 'OPTIONS':
                    response_headers = (
                        'HTTP/1.1 204 No Content\r\n'
                        'Access-Control-Allow-Origin: *\r\n'
                        'Access-Control-Allow-Methods: POST, OPTIONS\r\n'
                        'Access-Control-Allow-Headers: content-type\r\n'
                        'Access-Control-Max-Age: 86400\r\n'
                        'Content-Length: 0\r\n'
                        'Connection: keep-alive\r\n'
                        '\r\n'
                    )
                    client_socket.sendall(response_headers.encode('utf-8'))
                    continue

                # Manejar la solicitud POST
                if method == 'POST':
                    try:
                        message = json.loads(body)
                        url = message.get('url')
                    except json.JSONDecodeError as e:
                        break

                    if url:
                        print(f"URL recibida desde la extensión: {url}")

                        if "twitch.tv" in url:
                            if "/moderator/" in url:
                                mode = 1
                                streamer = url.split("/")[4]
                            else:
                                mode = 2
                                streamer = url.split("/")[3]
                            try:
                                urlgettitle = f"https://api.makatunga.com/api/twitch/infostream/{streamer}"
                                response = requests.get(urlgettitle)
                                title = response.json()['data'][0]['title']
                            except Exception as e:
                                title = "Null"
                            update_rpc(url, title, streamer, mode)
                        else:
                            update_rpc(url)


                        # Enviar una respuesta opcionalmente
                        response = {
                            'message': 'URL recibida correctamente'
                        }
                        response_headers = (
                            'HTTP/1.1 200 OK\r\n'
                            'Content-Type: application/json\r\n'
                            'Access-Control-Allow-Origin: *\r\n'
                            'Content-Length: {}\r\n'
                            'Connection: keep-alive\r\n'
                            '\r\n'
                        ).format(len(json.dumps(response)))
                        client_socket.sendall(response_headers.encode('utf-8') + json.dumps(response).encode('utf-8'))

            except json.JSONDecodeError as e:
                print(f"Error al decodificar JSON: {e}")

            finally:
                client_socket.close()

    except KeyboardInterrupt:
        print("\nDeteniendo el servidor...")
        if server_socket:
            server_socket.close()
        RPC.close()
        sys.exit(0)

    except Exception as ex:
        print(f"Error en el servidor: {ex}")
        if server_socket:
            server_socket.close()
        RPC.close()
        sys.exit(1)

if __name__ == "__main__":
    # iniciar el icono en un thread separado de el servidor
    print(callable(handle_extension_requests))
    threading.Thread(target=handle_extension_requests).start()
    threading.Thread(target=create_tray_icon).start()
 
